def solve(n, s):
	if n == 1 and s == 0:
		return "0 0"
	if s == 0 and n == 0: return "0 0"
	if s == 0: return "-1 -1";
	if 9 * n < s: return "-1 -1";
	if n == 1 and s < 10: return str(s) + ' ' + str(s)
	mn = ""
	mx = ""

	mx = "9" * (s // 9)
	if s % 9 != 0:
		mx += str(s % 9)
	mx = mx + "0" * (n - len(mx))
	if s % 9 == 0 and s//9 < n:
		mn = "9" * ((s-1) // 9)
		mn = str((s-1)%9)+mn
		mn = "0" * (n - len(mn) - 1) + mn
		mn = "1" + mn
		return mn + ' ' + mx

	if s % 9 == 0 and s//9 == n:
		return mx + ' ' + mx
	if s // 9 == n - 1:
		return str(s % 9) + "9" * (s // 9) + " " + mx
	mn = "9" * ((s - 1) // 9)
	if (s - 1) % 9 != 0:
		mn = str((s - 1) % 9) + mn

	mn ="0" * (n - len(mn) - 1) + mn
	if len(mn) != n:
		mn = "1" + mn
	return mn + ' ' + mx
while True:
